import "./MenuTap.css";
import Tab from 'react-bootstrap/Tab';
import Tabs from 'react-bootstrap/Tabs';
import MenuList from "./MenuList";
import {useEffect, useState} from 'react';
import axios from "axios";

function MenuTap() {
const[Alldata,setAlldata]=useState([]);

const allMenu=async()=>{await axios.post('http://127.0.0.1:8000/webKiosk/client/meca/download/',
  {
    "market_name" : "S"
  }).then(
    (response)=>{
      setAlldata(response.data)
    }
  );
}
useEffect(()=>{
  allMenu();
},[])

  return (
    <Tabs
      defaultActiveKey="profile"
      id="uncontrolled-tab-example"
      className="mb-3"
    >
    {Object.keys(Alldata).map((item)=>{
      return(
        <Tab eventKey={item} title={Alldata[item]['category_name']}>
        </Tab>
        )
    })}
    <Tap eventKey={"test"} title={"메뉴관리"}>
    <MenuList/>
    </Tap>
    </Tabs>
  );
}

export default MenuTap;
